BlocklyGamesMsg["Pond.helpText1"] = "အမြောက် ကိုအမိန့်ပေးပြီး ပစ်မှတ်ကိုပစ်ပါ။ ပထမဦးဆုံးအကန့်အသတ်မှာ ထောင့်ဖြစ်သည်။ ဒုတိယ အကန့်အသတ်မှာ အကွာအဝေးဖြစ်သည်။ မှန်ကန်သော ပေါင်းစပ်မှုကိုရှာဖွေပါ။";
BlocklyGamesMsg["Pond.helpText2"] = "ပစ်မှတ်သည်အကြိမ်များစွာထိမှန်ရန်လိုအပ်ပါသည်။ while (true) ကိုအသုံးပြုပြီး မတိကျမသေချာသည့် အရာတစ်ခုပြုလုပ်ပါ။";
BlocklyGamesMsg["Pond.helpText3a"] = "ပြိုင်ဘက်သည် ရှေ့နောက်ရွေ့လျားပြီး ထိမှန်ရန်ခက်ခဲအောင်ပြုလုပ်နေသည်။ Scan ကိုအသုံးပြုခြင်းသည် ပြိုင်ဘက်၏ အကွာအဝေးအတိအကျကို သတ်မှတ်ပေးသည်။";
