BlocklyGamesMsg["Pond.helpText4"] = "ပြိုင်ဘက်ကစားသမားသည် အမြောက်မှအလွန်ကွာဝေးစွာတည်ရှိနေသည် (မီတာ ၇၀ မှာအကန့်အသတ်ဖြစ်သည်) ထိုအစား ရေကူးခြင်း ကိုအသုံးပြီးပြိုင်ဘက်နှင့်နီးကပ်အောင်သွားပြီး တိုက်ခိုက်ပါ။";
BlocklyGamesMsg["Pond.helpText5"] = "အမြောက်ကိုအသုံးပြုရန်အတွက် ပြိုင်ဘက်သည်ဝေးလွန်းနေသည်။ သို့သော်လည်း တိုက်ခိုက်မှုတွင် သင်အသက်ရှင်ကျန်ရစ်ရန်အတွက် အားနည်းလွန်းနေသည်။ သင်၏ ရေပြင်ညီတည်နေရာ ၅ဝထက်လျော့ပါက ပြိုင်ဘက်ထံသို့ကူးခတ်သွားပါ။ ထို့နောက်ရပ်ပြီး အမြောက်ကိုအသုံးပြုပါ။";
BlocklyGamesMsg["Pond.helpText6"] = "တိုက်မိသည့်အချိန်တွင် ပြိုင်ဘက်ကစားသမားသည် ထွက်ပြေးသွားမည်ဖြစ်သည်။ အပိုင်းအခြားထက်ကျော်လွန်ပါက ၎င်းထံသို့ကူးခတ်သွားပါ။ (မီတာ ၇၀)";
